app.initializeAutofill = function(field, data) {
  $(field).keyup(function(e) {

    fill();

    // var fillIt = setTimeout(fill, 250);
    // $(field).on('keydown', cancelFill);
    //
    // function cancelFill() {
    //   clearTimeout(fillIt);
    //   $(field).off('keydown', cancelFill);
    // }

    function fill() {
      if (!((e.keyCode >= 65 && e.keyCode <= 90) || e.keyCode === 32 || e.keyCode === 189)) {
        return;
      }

      var term = $(field).val();
      var searchTerm = term.toLowerCase();
      var index = -1;

      for (var i = 0; i < data.length; ++i) {
        if (data[i].name.toLowerCase().indexOf(searchTerm) === 0) {
          index = i;
          break;
        }
      }

      if (index === -1) {
        return;
      }

      // $(field).off('keydown', cancelFill);

      field.value = term + data[index].name.slice(term.length);
      field.setSelectionRange(term.length, data[index].name.length);
    }
  });
};
app.bounce = function(secure) {

  var id = $('body').data('id');
  var type = $('body').data('type');

  $('.modal-wrapper').removeClass('visible');

  if (!secure && type) {
    if (type === 'Doctor') {
      redirectResearcher(id);
      return true;
    } else {
      redirectOrganization(id);
      return true;
    }
  } else if (secure && !id) {
      toLandingPage();
      return true;
  }

  return false;

  function redirectOrganization(id) {
    document.location.hash = 'admin/' + id;
  }

  function redirectResearcher(id) {
    document.location.hash = 'researcher/' + id + '/trials/';
  }

  function toLandingPage() {
    document.location.hash = '';
  }

}
;
app.addressAutofill = function() {

  var placeSearch, autocomplete;
  var componentForm = {
    street_number: 'short_name',
    route: 'long_name',
    locality: 'long_name',
    administrative_area_level_1: 'short_name',
    country: 'long_name',
    postal_code: 'short_name'
  };

  initialize();
  $('#autocomplete').focus(geolocate());

  function initialize() {
    // Create the autocomplete object, restricting the search
    // to geographical location types.
    autocomplete = new google.maps.places.Autocomplete(
        /** @type {HTMLInputElement} */(document.getElementById('autocomplete')),
        { types: ['geocode'] });
    // When the user selects an address from the dropdown,
    // populate the address fields in the form.
    // google.maps.event.addListener(autocomplete, 'place_changed', function() {
    //   fillInAddress();
    // });
  }

  // [START region_fillform]
  function fillInAddress() {
    // Get the place details from the autocomplete object.
    var place = autocomplete.getPlace();

    for (var component in componentForm) {
      document.getElementById(component).value = '';
      document.getElementById(component).disabled = false;
    }

    // Get each component of the address from the place details
    // and fill the corresponding field on the form.
    for (var i = 0; i < place.address_components.length; i++) {
      var addressType = place.address_components[i].types[0];
      if (componentForm[addressType]) {
        var val = place.address_components[i][componentForm[addressType]];
        document.getElementById(addressType).value = val;
      }
    }
  }
  // [END region_fillform]

  // [START region_geolocation]
  // Bias the autocomplete object to the user's geographical location,
  // as supplied by the browser's 'navigator.geolocation' object.
  function geolocate() {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(function(position) {
        var geolocation = new google.maps.LatLng(
            position.coords.latitude, position.coords.longitude);
        var circle = new google.maps.Circle({
          center: geolocation,
          radius: position.coords.accuracy
        });
        autocomplete.setBounds(circle.getBounds());
      });
    }
  }
  // [END region_geolocation]
}
