app.routeDefault = function() {
  if(app.bounce()) {
    return;
  }

  var searchTerm;

  $('#main-content').html($('#landing-page').html());

  $.getJSON('/api/v1/conditions').done(function(data) {
    var numTrials = data.conditions[0];
    var numOrgs = data.conditions[1];
    $('.num-trials-actual').text(numTrials);
    $('.num-conditions-actual').text(data.conditions[2].length);
    $('.num-orgs-actual').text(numOrgs);

    enterStats();

    var conditions = data.conditions[2];

    app.initializeAutofill(document.getElementById('condition-search'), conditions);
  });

  $('.search-form').submit(function(e) {
    e.preventDefault();

    if (!validateInput()) {
      return;
    }

    searchTerm = $('#condition-search').val();

    $.getJSON('/api/v1/search', { type: 'condition', query: $('#condition-search').val() }).done(function(data) {
      if (data.searches[1].length === 0) {
        $('.srch-error-message').text('sorry, no matches');
        $('.login-error-message').text('');
        return;
      }
      var excludeList = [];
      data.searches[1].forEach(function(item) {
        excludeList.push(item);
      });

      var listTemplate = _.template(app.exclusionFormTemplate, { variable: 'm' });
      $('.xcld-frm-cntnr').html(listTemplate({ exclusions: excludeList }));
      initializeExclusionForm()
    });

  });

  function enterStats() {
    setTimeout(function() {
      $('.numTrials').addClass('nt-vis');
    }, 500);
    setTimeout(function() {
      $('.numConditions').addClass('nc-vis');
    }, 1600);
    setTimeout(function() {
      $('.numOrgs').addClass('no-vis');
    }, 2700);
  }

  function initializeExclusionForm() {
    $('#exclusion-form').submit(function(e) {
      e.preventDefault();
      var exclusionChecks = [];
      $(':checked').toArray().forEach(function(item) {
        exclusionChecks.push(Number($(item).val()));
      });

      var url = '/api/v1/conditions/trials?condition=' + searchTerm + '&&exclusions=';
      exclusionChecks.forEach(function(item) {
        url += item + ',';
      });

      url = encodeURIComponent(url);

      document.location.hash = 'search/' + url;

    });
  }

  function validateInput() {
    if (!$('#condition-search').val()) {
      $('.srch-error-message').text('search term required');
      return false;
    }
    return true;
  }
}
;
app.routeOrganizationTrials = function(r) {
  if (app.bounce(true)) {
    return;
  }
  $('#main-content').html($('#admin-trials').html());
  var trials = [];
  var listState = [];
  $.getJSON('/api/v1/trials/org', { org: r.params.id }).done(function(data) {
    trials = data.trials;
    listState = trials;
    showList();
  });

  function showList() {
    var listTemplate = _.template(app.trialListing.researcher, { variable: 'm' });
    $('.trial-list').html(listTemplate({ results: listState }));
    addNameListeners();
  }

  function addNameListeners() {
    $('.rslt-name').toArray().forEach(function(name, i) {
      $(name).click(function(e) {
        var detailTemplate = _.template(app.trialDetail.admin, { variable: 'm' });
        $('.trial-list').html(detailTemplate({ trial: listState[i] }));
        $('.bck-btn').click(showList);
      });
    });
  }
  $('.search-trials-input').keyup(function(e) {
    var term = $('.search-trials-input').val().toLowerCase();

    if (!term) {
      listState = trials;
      showList();
      return;
    }

    var show = setTimeout(performSearch, 250);

    $('.search-trials-input').on('keydown', cancelSearch);

    function cancelSearch() {
      clearTimeout(show);
      $('.search-trials-input').off('keydown', cancelSearch);
    }

    function performSearch() {
      $('.search-trials-input').off('keydown', cancelSearch);
      var tempState = listState;
      listState = [];
      trials.forEach(function(trial) {
        var ref = buildSearchRef(trial).toLowerCase();
        if (ref.indexOf(term) > -1) {
          listState.push(trial)
        }
      });
      showList();
    }

    function buildSearchRef(obj) {
      var ref;
      ref += obj.name;
      ref += obj.location;
      ref += obj.principal;
      ref += obj.start_on;
      obj.conditions.forEach(function(item) {
        ref += item.name;
      });

      return ref;
    }

  })
};
