app.routeSearchResults = function(r) {
  if (app.bounce()) {
    return;
  }

  var trials = [];
  listState = [];
  $('#main-content').html($('#search-results').html());
  setHeader();
  $.getJSON(decodeURIComponent(r.params.criteria) + '&&location=&&range=').done(function(data) {
    if (data.conditions.length > 0) {
      trials = data.conditions;
      listState = trials;
      showAllResults();
      initializeGeoform();
      initializeGeoClear();
    } else {
      app.populateSaveMe(grabSearchTerm(), grabExclusionIds());
    }
  });

  function initializeGeoform() {

    $('.geo-form').submit(function(e) {
      e.preventDefault();

      if (!validateInput()) {
        $('.error-message').text('invalid input');
        return;
      }

      $('.error-message').text('');

      var url = decodeURIComponent(r.params.criteria) + '&&location=' + $('.zip-input').val() + '&&range=' + $('.range-input').val();
      $.getJSON(url).done(function(data) {
        listState = data.conditions;
        showAllResults();
      });
    });
  }

  function initializeGeoClear() {
    $('.clear-geo-btn').click(function() {
      $('.zip-input').val('');
      $('.range-input').val('');
      listState = trials;
      showAllResults();
    });
  }

  function showAllResults() {
    var listTemplate = _.template(app.trialListing.search, { variable: 'm' });
    $('.rslts-list').html(listTemplate({ results: listState }));
    addNameListeners();
  }

  function addNameListeners() {
    $('.rslt-name').toArray().forEach(function(name, i) {
      $(name).click(function(e) {
        var detailTemplate = _.template(app.trialDetail.search, { variable: 'm' });
        $('.rslts-list').html(detailTemplate({ trial: listState[i] }));
        $('.bck-btn').click(showAllResults);
        initializeRequestBtn();
        $.ajax({
          type: "POST",
          url: '/api/v1/trials/' + listState[i].id + '/views',
        });
      });
    });
  }

  function initializeRequestBtn() {
    $('.more-info-btn').click(function() {
      var email = $('.more-info-input');
      if (!email.val().match(/[a-z0-9._%+-]+@[a-z0-9.-]+\.[A-Za-z]{2,4}/)) {
        $('.more-info-error-message').text('invalid-input');
        return;
      } else {
        $('.more-info-error-message').text('application requested!');
        $('.more-info-error-message').css('color', 'seagreen');
        $('.more-info-input').attr('disabled', true);
        $('.more-info-btn').attr('disabled', true);
      }
    });
  }

  function grabSearchTerm() {
    var url = decodeURIComponent(r.params.criteria);
    return url.match(/condition=(.*)(?=&&)/)[1];
  }

  function grabExclusionIds() {
    var url = decodeURIComponent(r.params.criteria);
    var ids = url.match(/exclusions=(.*)/)[1].split(',');
    ids.splice(ids.length - 1, 1);
    return ids;
  }

  function setHeader() {
    var searchTerm = grabSearchTerm();
    $('.s-results-header').text('your results for "' + searchTerm + '"');
  }

  function validateInput() {
    var zip = $('.zip-input').val();
    var range = $('.range-input').val();
    if (!zip && !range) {
      return false;
    }
    if (zip.match(/[.]/) || !Number(zip) || range.match(/[.]/) || !Number(range) || zip.length < 5) {
      return false;
    }
    return true;
  }
};
app.routeCreateTrialBasic = function(r) {
  if (app.bounce(true)) {
    return;
  }

  $('#main-content').html($('#create-study').html());

  app.addressAutofill();

  $('.trial-start-input').pickadate({
    format: 'mmmm d, yyyy'
  });
  $('.trial-complete-input').pickadate({
    format: 'mmmm d, yyyy'
  });

  $('.create-trial-form').submit(function(e) {
    e.preventDefault();
    if (!validateForm()) {
      return;
    }
    var newTrial = grabTrialInfo();
    postTrial(newTrial);
  });

  function validateForm() {
    var isValid = true

    if (!$('.trial-email-input').val().match(/[a-z0-9._%+-]+@[a-z0-9.-]+\.[A-Za-z]{2,4}/)) {
      $('.error-message').text('not a valid email');
      isValid = false;
    }

    $('.trial-input').toArray().forEach(function(item) {
      if (!$(item).val() || $(item).val() === '') {
        isValid = false;
        $('.error-message').text('all fields are required');
      }
      if (isValid && !verifyDates()) {
        isValid = false;
      }
    });
    return isValid;
  }

  function grabTrialInfo() {
    return {
      trial: {
        condition_ids: grabConditionIds(),
        conditions_attributes: grabConditionNames(),
        exclusion_ids: grabExclusionIds(),
        exclusions_attributes: grabExclusionNames(),
        principal: $('.trial-principal-input').val(),
        active: true,
        primary_contact_email: $('.trial-email-input').val(),
        location: $('.trial-location-input').val(),
        name: $('.trial-title-input').val(),
        start_on: $('.trial-start-input').val(),
        estimated_completed_on: $('.trial-complete-input').val(),
        description: $('.trial-abstract-input').val(),
        doctor_id: r.params.id,
      },
    };
  }

  function postTrial(arg) {
    $.ajax({
      type: "POST",
      url: '/api/v1/trials',
      data: JSON.stringify(arg),
      contentType : 'application/json',
      dataType: 'json'
    }).done(function(data) {
      document.location.hash = 'researcher/' + r.params.id + '/trials';
    });
  }

  function verifyDates() {
    var now = new Date().getTime()
    var start = new Date($('.trial-start-input').val()).getTime();
    var complete = new Date($('.trial-complete-input').val()).getTime();
    if (start <= now) {
      $('.error-message').text('trials cannot begin in the past');
      return false;
    }
    if (start >= complete) {
      $('.error-message').text('est. complete date must be later than start date');
      return false;
    }
    return true;
  }

  $.getJSON('/api/v1/exclusions').done(function(data) {
    var contraTemplate = _.template(app.contraOption, { variable: 'm' });
    $('.contra-selector').html(contraTemplate({ contras: data.exclusions }));
  });

  $('.contra-selector').select2({
    tags: true,
    theme: 'classic',
    dropdownParent: document.querySelector('body'),
  });

  $.getJSON('/api/v1/conditions').done(function(data) {
    var contraTemplate = _.template(app.contraOption, { variable: 'm' });
    $('.trial-condition-input').html(contraTemplate({ contras: data.conditions[2] }));
  });

  $('.trial-condition-input').select2({
    tags: true,
    theme: 'classic',
    dropdownParent: document.querySelector('body'),
  });

  function grabExclusionNames() {
    var exclusionNames = [];

    if ($('.contra-selector').val()) {
      $('.contra-selector').val().forEach(function(item) {
        if (!Number(item)) {
          exclusionNames.push({ name: item });
        }
      });
    }

    return exclusionNames;
  }

  function grabExclusionIds() {
    var exclusionIds = [];

    if ($('.contra-selector').val()) {
      $('.contra-selector').val().forEach(function(item) {
        if (Number(item)) {
          exclusionIds.push(Number(item));
        }
      });
    }

    return exclusionIds;
  }

  function grabConditionNames() {
    var conditionNames = [];

    if ($('.trial-condition-input').val()) {
      $('.trial-condition-input').val().forEach(function(item) {
        if (!Number(item)) {
          conditionNames.push({ name: item });
        }
      });
    }

    return conditionNames;
  }

  function grabConditionIds() {
    var conditionIds = [];

    if ($('.trial-condition-input').val()) {
      $('.trial-condition-input').val().forEach(function(item) {
        if (Number(item)) {
          conditionIds.push(Number(item));
        }
      });
    }

    return conditionIds;
  }

}
